import React from 'react';
import { useState, useEffect } from 'react';
import Axios from 'axios';

const style = {
	fontSize: '30px',
	fontFamily: 'serif',
	backgroundColor: '#F8F8FF',
	textTransform: 'uppercase',
	textAlign: 'center',
};

const style1 = {
	color: 'black',
	fontSize: '30px',
	fontFamily: 'serif',
	backgroundColor: '#F8F8FF',
	textAlign: 'center',
	textTransform: 'uppercase',
};

const style2 = {
	color: 'white',
	fontFamily: 'sans-serif',
	fontSize: '20px',
	backgroundColor: 'black',
	textAlign: 'center',
	display: 'inline-block',
	padding: '0.5em 3em',
	border: '0.16em solid #FFFFFF',
	margin: '0 0.3em 0.3em 0',
	boxSizing: 'border-box',
	textDecoration: 'none',
	textTransform: 'uppercase',
	fontWeight: '400',
	transition: 'all 0.15s',
};

const Menu = () => {

	const [getOrderburger, setOrderburger] = useState('Cheese Burger');
	const [getOrderlist, setOrderlist] = useState('');

	useEffect(() => {
		Axios.get('http://localhost:3001/getBurger').then((response) => {
			setOrderlist(response.data);
		});
	}, []);

	const handleSubmit = (e) => {
		e.preventDefault();
		Axios.post('http://localhost:3001/insertBurger', {
			burger_name: getOrderburger,
		}).then((response) => {
			alert('Insert Successfully');
		});
	};

	return (
		<div style={style}>
			<table class='table'>
				<tbody>
					<tr className='cl3'>
						<th scope='row'>Burger King Menu Whopper</th>
						<th scope='row'>Whiskey River BBQ Burger</th>
						<th scope='row'>Bacon Cheeseburger</th>
						<th scope='row'>Shake Shack Burger</th>
					</tr>
					<tr>
						<td>
							<img
								src='https://www.thepackagingcompany.us/knowledge-sharing/wp-content/uploads/sites/2/2019/05/ip-bk-whopper-blog.jpg'
								alt='new'
								width={'400px'}
								height={'500px'}
							/>
						</td>

						<td>
							<img
								src='https://media.istockphoto.com/photos/fried-chicken-sandwich-picture-id511520568?k=20&m=511520568&s=612x612&w=0&h=4SChcngzqOE2nNCEQV26ZCtA84BlhAshnxcdN5Beb7I='
								alt='new'
								width={'400px'}
								height={'500px'}
							/>
						</td>

						<td>
							<img
								src='https://previews.123rf.com/images/belchonock/belchonock1902/belchonock190209458/116958943-tasty-burger-with-bacon-on-white-background.jpg'
								alt='new'
								width={'400px'}
								height={'500px'}
							/>
						</td>

						<td>
							<img
								src='https://food.fnr.sndimg.com/content/dam/images/food/fullset/2017/5/10/0/FNM_060117-Shake-Shack-Style-Burgers-Recipe_s4x3.jpg.rend.hgtvcom.616.462.suffix/1494459385949.jpeg'
								alt='new'
								width={'400px'}
								height={'500px'}
							/>
						</td>
					</tr>
				</tbody>
			</table>
			<br />

			<form onSubmit={handleSubmit}>
			<div className='card'>
									<input
										type='text'
										className=''
										value={getOrderburger}
										onChange={(e) => setOrderburger(e.target.value)}
									/><br/>
														<button type=''>Add to Cart</button>

								</div>
								
				<br />
			</form>
			<br />
			<br />
			<br />
			<br />

			<div class='card'>
				<h1>Cheeseburger</h1>
				<img
					src='https://previews.123rf.com/images/belchonock/belchonock1902/belchonock190209458/116958943-tasty-burger-with-bacon-on-white-background.jpg'
					alt='new'
					width={'300px'}
					height={'300px'}
				/>
				<p class='price'>$19.99</p>
				<p>
					Some text about the jeans. Super slim and comfy lorem ipsum lorem
					jeansum. Lorem jeamsun denim lorem jeansum.
				</p>
				<p>
					<button>Add to Cart</button>
				</p>
			</div>
		</div>
	);
};
export default Menu;
